import React, {Component} from 'react';
import {Col, Row} from 'reactstrap';

// style
import './Credits.scss';

const people = [
  {
    name: "Naveen Kharwar",
    url: "https:\/\/naveenkharwar.com",
    description: "A freelance graphic designer, Web/WordPress developer and a geek.",
    image: require("./images/naveen.jpeg"),
    socialLink1: "",
    socialLink2: "",
    socialLink3: "",
    id: '1'
  },
]

class Credits extends Component{
  render() {
    return (
      <div className="container-fluid">
        <Col className="text-center">
          <div className="container-fluid credits">
              <h4>CREDITS FOR THIS PROJECT</h4>
          </div>
        {
          people.map( person =>
            <div key={person.id}>
              <Col sm="12" md="6" lg="4">
                <img className="img" src={person.image} alt="Naveen Kharwar" />
                <h3>{person.name}</h3>
                 <p>{person.description}</p>
              </Col>
            </div>
          )
        }
      </Col>
      </div>
    );
  }
}

export default Credits;
